#include <stdio.h>

char grid[128][128];

void delete(int i, int j) {
	if (i < 0 || i > 127 || j < 0 || j > 127) {
		return;
	}
	if (grid[i][j] == '1') {
		grid[i][j] = '0';
		delete(i-1,j);
		delete(i+1,j);
		delete(i,j+1);
		delete(i,j-1);
	}
}

int region() {
	for (int i = 0; i < 128; i++) {
		for (int j = 0; j < 128; j++) {
			if (grid[i][j] == '1') {
				delete(i,j);
				return 1;
			}
		}
	}
	return 0;
}

int main() {
	int count = 0;
	while (region() == 1) {
		count++;
	}
	printf("%d\n", count);
	return 0;
}

